export default function fundo({ children: fundo = null }) {
  const dez = fundo.relatorio.filter((item) => {
    return item.month === 12;
  });
  console.log(dez);
  if (!fundo) {
    return <div>Sem Fundos</div>;
  }
  return (
    <div className="border p-1 border-gray-light m-2">
      {fundo.description}{" "}
      {fundo.relatorio.filter((item) => {
        return item.month === 12;
      })}
    </div>
  );
}
